import React from "react";
import Header from "../components/Header";

const Home = () => {
  return (
    <>
      <Header />
      <div style={{ padding: "50px", textAlign: "center" }}>
        <h1>Welcome to BuyNow</h1>
        <p>Your favorite e-commerce platform.</p>
      </div>
    </>
  );
};

export default Home;
